--
-- Name: catastrophes_views; Type: MATERIALIZED VIEW; Schema: public; Owner: root
--

CREATE MATERIALIZED VIEW public.catastrophes_views AS
 SELECT pc.id AS catastrophe_id,
    pc.uuid,
    pc.created_at,
    pc.updated_at,
    pc."typeCatastrophe",
    pc.date,
    pc.heure,
    pc."nbreTotalMenage",
    pc."nbreTotalPersonne",
    pc."nbreHomme",
    pc."nbreFemme",
    pc."nbreEnfant",
    pc."quantiteDenre",
    pc."typeDenre",
    pc."uniteDenre",
    pc.material,
    pc.duree,
    pc."uniteDuree",
    pc.traite,
    pc.description,
    pc.cause,
    pc."lieuInstallation",
    pc.lat,
    pc.lng,
    pc.altitude,
    pc."precision",
    pc."regionId" AS region_id,
    pc."prefectureId" AS prefecture_id,
    pc."communeId" AS commune_id,
    pc."userId" AS user_id,
    pc."isDelete",
    pc.revision,
    pc."nbreBlesse",
    pc."nbreMort",
    us.first_name,
    us.last_name,
    reg.nom AS region_nom,
    pref.nom AS prefecture_nom,
    com.nom AS commune_nom
   FROM ((((public.catastrophe pc
     JOIN public."user" us ON ((us.id = pc."userId")))
     JOIN public.region reg ON ((reg.id = pc."regionId")))
     JOIN public.prefecture pref ON ((pref.id = pc."prefectureId")))
     JOIN public.commune com ON ((com.id = pc."communeId")))
  WHERE (pc."isDelete" = false)
  ORDER BY pc.id DESC
  WITH NO DATA;


ALTER TABLE public.catastrophes_views OWNER TO root;

