--
-- Name: enquete_deplace_interne_views; Type: MATERIALIZED VIEW; Schema: public; Owner: root
--

CREATE MATERIALIZED VIEW public.enquete_deplace_interne_views AS
 SELECT edi.id,
    edi.revision,
    edi.uuid,
    edi.date_enregistrement,
    edi.date_enquete,
    edi.localite_menage,
    edi.code_menage,
    edi.chef_menage,
    edi.age,
    edi.sexe,
    edi.profession,
    edi.active_actuelle,
    edi.telephone,
    edi.taille_menage,
    edi.nombre_femme,
    edi.nombre_handicap,
    edi.nombre_enfant,
    edi.type_reinstallation,
    edi.retour_processus_reinstallation,
    edi.maison_touche,
    edi.dedommagement,
    edi.impliquer_pour_decision,
    edi.cause_implication,
    edi.type_accompagnement,
    edi.besoin_prioritaire,
    edi.service_sociaux,
    edi.attente_compensation,
    edi.terre_perdu,
    edi.type_terre,
    edi.type_demande_habitation,
    edi.motif_satisfaction_demande,
    edi.aide_entreprendre,
    edi.type_aide,
    edi.retour_collaboration,
    edi.apreciation_collaration,
    edi.aide_suppelementaire,
    edi.attente_personnelle,
    edi.type_activite,
    edi.obstacle,
    edi.source_revenue,
    edi.depense_trimestre,
    edi.provenance_eau,
    edi.distance_provenance_eau,
    edi.naissance_suvenue,
    edi.lieu_naissance,
    edi.nom_centre,
    edi.observation,
    edi."typeEnqueteId",
    ( SELECT te.name
           FROM public.type_enquete te
          WHERE (te.id = edi."typeEnqueteId")
         LIMIT 1) AS enquete_name,
    ( SELECT c.nom
           FROM public.commune c
          WHERE (c.id = edi."communeId")
         LIMIT 1) AS commune_name,
    ( SELECT c.id
           FROM public.commune c
          WHERE (c.id = edi."communeId")
         LIMIT 1) AS commune_id,
    edi."isDelete",
    edi."userId",
    us."regionId",
    us."prefectureId",
    us."communeId",
    concat(us.first_name, ' ', us.last_name) AS full_name
   FROM (public.enquete_deplace_interne edi
     JOIN public."user" us ON ((us.id = edi."userId")))
  WHERE (edi."isDelete" = false)
  WITH NO DATA;


ALTER TABLE public.enquete_deplace_interne_views OWNER TO root;

