--
-- Name: references_views; Type: MATERIALIZED VIEW; Schema: public; Owner: root
--

CREATE MATERIALIZED VIEW public.references_views AS
 SELECT pref.id,
    pref.created_at,
    pref.updated_at,
    pref.catastrophe,
    pref.habitude_alimentaire,
    pref.accessibilite_saison,
    pref.ong,
    pref.couverture_reseau,
    pref.accessibilite_moyen,
    pref.disponibilite_produit,
    pref."userId" AS user_id,
    concat(us.first_name, ' ', us.last_name) AS full_name,
    pref."isDelete",
    pref.revision,
    pref.periode,
    pref.date_enregistrement,
    pref.activite_professionnelle
   FROM (public.reference pref
     JOIN public."user" us ON ((us.id = pref."userId")))
  WHERE (pref."isDelete" = false)
  WITH NO DATA;


