--
-- Name: produit_prefecture_views; Type: MATERIALIZED VIEW; Schema: public; Owner: root
--

CREATE MATERIALIZED VIEW public.produit_prefecture_views AS
 SELECT date_trunc('month'::text, (pp.date)::timestamp with time zone) AS date_prix,
    reg.nom AS region,
        CASE
            WHEN ((reg.nom)::text = 'Conakry'::text) THEN cm.nom
            ELSE prf.nom
        END AS prefecture,
    us.id AS user_id,
    us.first_name AS user_first_name,
    us.last_name AS user_last_name,
    count(pp.id) AS nombre,
    string_agg(((pp.id)::character varying)::text, ','::text) AS produit_ids
   FROM ((((public.produit_prefectures pp
     JOIN public."user" us ON ((us.id = pp."userId")))
     JOIN public.prefecture prf ON ((pp."prefectureId" = prf.id)))
     JOIN public.region reg ON ((prf."regionId" = reg.id)))
     JOIN public.commune cm ON ((us."communeId" = cm.id)))
  GROUP BY (date_trunc('month'::text, (pp.date)::timestamp with time zone)), reg.nom,
        CASE
            WHEN ((reg.nom)::text = 'Conakry'::text) THEN cm.nom
            ELSE prf.nom
        END, us.id
  ORDER BY (date_trunc('month'::text, (pp.date)::timestamp with time zone)) DESC, reg.nom,
        CASE
            WHEN ((reg.nom)::text = 'Conakry'::text) THEN cm.nom
            ELSE prf.nom
        END DESC
  WITH NO DATA;


ALTER TABLE public.produit_prefecture_views OWNER TO root;

