COPY public.typeorm_metadata (type, database, schema, "table", name, value) FROM stdin;
MATERIALIZED_VIEW	\N	public	\N	produit_prefecture_views	SELECT DATE_TRUNC('month', pp.date) as date_prix,\n      reg.nom as region,\n      CASE\n        WHEN reg.nom = 'Conakry' THEN cm.nom\n        ELSE prf.nom \n        END as prefecture,\n      us.id as user_id,\n      us.first_name as user_first_name,\n      us.last_name as user_last_name,\n      COUNT(pp.id) as nombre,\n      string_agg(pp.id::character varying, ',') as produit_ids\n    FROM public.produit_prefectures pp\n    INNER JOIN public.user us on us.id = "pp"."userId"\n    INNER JOIN public.prefecture prf on "pp"."prefectureId" = prf.id\n    INNER JOIN public.region reg on "prf"."regionId" = reg.id\n    INNER JOIN public.commune cm on "us"."communeId" = cm.id\n    GROUP BY date_prix,region, prefecture, user_id\n    ORDER BY date_prix desc, region, prefecture desc
MATERIALIZED_VIEW	\N	public	\N	catastrophes_views	SELECT pc."id" as "catastrophe_id", \n\t\t\t\tpc."uuid" as "uuid", \n\t\t\t\tpc.created_at as created_at,\n\t\t\t\tpc.updated_at as updated_at,\n\t\t\t\t"typeCatastrophe", \n\t\t\t\t"date", \n\t\t\t\t"heure", \n\t\t\t\t"nbreTotalMenage",\n\t\t\t\t"nbreTotalPersonne", \n\t\t\t\t"nbreHomme", \n\t\t\t\t"nbreFemme", \n\t\t\t\t"nbreEnfant", \n\t\t\t\t"quantiteDenre", \n\t\t\t\t"typeDenre", \n\t\t\t\t"uniteDenre", \n\t\t\t\t"material",\n\t\t\t\t"duree", \n\t\t\t\t"uniteDuree", \n\t\t\t\t"traite", \n\t\t\t\t"description", \n\t\t\t\t"cause", \n\t\t\t\t"lieuInstallation", \n\t\t\t\t"lat", \n\t\t\t\t"lng", \n\t\t\t\t"altitude", \n\t\t\t\t"precision",\n\t\t\t\tpc."regionId" as "region_id", \n\t\t\t\tpc."prefectureId" as "prefecture_id", \n\t\t\t\tpc."communeId" as "commune_id",\n\t\t\t\tpc."userId" as user_id, \n\t\t\t\t"isDelete", revision,"nbreBlesse", "nbreMort",\n\t\t\t\tus.id as user_id,\n\t\t\t\tus.first_name as first_name,\n\t\t\t\tus.last_name as last_name,\n\t\t\t\treg.nom as region_nom,\n\t\t\t\tpref.nom as prefecture_nom,\n\t\t\t\tcom.nom as commune_nom\n\t\t\tFROM public.catastrophe pc\n\t\t\tINNER JOIN public.user us on us.id = "pc"."userId"\n\t\t\tINNER JOIN public.region reg on reg.id = "pc"."regionId"\n\t\t\tINNER JOIN public.prefecture pref on pref.id = "pc"."prefectureId"\n\t\t\tINNER JOIN public.commune com on com.id = "pc"."communeId"\n\t\t\tWHERE pc."isDelete" = false \n\t\t\tORDER BY catastrophe_id desc
MATERIALIZED_VIEW	\N	public	\N	references_views	SELECT \n    pref."id" as id, \n    pref."created_at" as created_at, \n    pref."updated_at" as updated_at, \n    pref."catastrophe" as catastrophe , \n    "habitude_alimentaire", \n    "accessibilite_saison", \n    "ong", \n    "couverture_reseau", \n    "accessibilite_moyen",\n    "disponibilite_produit", \n    pref."userId" as user_id,\n    concat(us.first_name, ' ', us.last_name) as full_name,\n    "isDelete", \n    "revision", \n    "periode", \n    "date_enregistrement", \n    "activite_professionnelle"\n  FROM public.reference pref\n  INNER JOIN public.user us on us.id = "pref"."userId"\n  where pref ."isDelete" = false
MATERIALIZED_VIEW	\N	public	\N	enquete_deplace_interne_views	SELECT \n  edi.id as id, \n  edi.revision, \n  edi.uuid, \n  edi.date_enregistrement, \n  edi.date_enquete, \n  edi.localite_menage, \n  edi.code_menage, \n  edi.chef_menage, \n  edi.age, \n  edi.sexe, \n  edi.profession, \n  edi.active_actuelle, \n  edi.telephone, \n  edi.taille_menage, \n  edi.nombre_femme, \n  edi.nombre_handicap, \n  edi.nombre_enfant, \n  edi.type_reinstallation, \n  edi.retour_processus_reinstallation, \n  edi.maison_touche, \n  edi.dedommagement, \n  edi.impliquer_pour_decision, \n  edi.cause_implication, \n  edi.type_accompagnement, \n  edi.besoin_prioritaire, \n  edi.service_sociaux, \n  edi.attente_compensation, \n  edi.terre_perdu, \n  edi.type_terre, \n  edi.type_demande_habitation, \n  edi.motif_satisfaction_demande, \n  edi.aide_entreprendre, \n  edi.type_aide, \n  edi.retour_collaboration, \n  edi.apreciation_collaration,\n  edi.aide_suppelementaire, \n  edi.attente_personnelle, \n  edi.type_activite, \n  edi.obstacle, \n  edi.source_revenue, \n  edi.depense_trimestre, \n  edi.provenance_eau, \n  edi.distance_provenance_eau, \n  edi.naissance_suvenue, \n  edi.lieu_naissance, \n  edi.nom_centre, \n  edi.observation,\n  edi."typeEnqueteId" as "typeEnqueteId",\n  (select te.name from public.type_enquete te where te.id = edi."typeEnqueteId" limit 1) as enquete_name,\n  (select c.nom from public.commune c where c.id = edi."communeId" limit 1) as commune_name,\n  (select c.id from public.commune c where c.id = edi."communeId" limit 1) as commune_id,\n  edi."isDelete", \n  edi."userId",\n  us."regionId",\n  us."prefectureId",\n  us."communeId",\n  concat(us.first_name, ' ', us.last_name) as full_name\n  FROM public.enquete_deplace_interne edi\n  INNER JOIN public.user us on us.id = "edi"."userId"\n  where edi."isDelete" = false;
\.
